func findTheDifference(s string, t string) byte {
	if s == "" {
		return []byte(t)[0]
	}
	var index int
	freq:=make([]int,26)
	for i:=0;i<len(t);i++{
		freq [t[i] - 'a'] ++
	}
	for i:=0;i<len(s);i++{
		freq[s[i]-'a']--
		
	}

	for k,v:=range freq{
		if v!=0 {
			index=k
		}
	}
	fmt.Println(freq)

    return 'a'+byte(index)
}

func findTheDifference2(s string, t string) byte {
	c := t[len(t)-1]
	for i := 0; i < len(t)-1; i++ {
		c ^= s[i]
		c ^= t[i]
	}
	return c
}